import * as axios from "axios";

const instance = axios.create({
    baseURL: 'https://my-json-server.typicode.com/RaySkelen/demo/',
    withCredentials: true,
    headers: {}
})

export const dataAPI = {
    getConfig() {
        return instance.get('config').then(response => {return console.log(response)})
    },
    getData() {
        return instance.get('config').then(response => {return console.log(response)})
    },
    getGameState() {
        return instance.get('config').then(response => {return console.log(response)})
    }
}
